import React, { useEffect ,useState} from 'react';
import axios from 'axios';

function AddTrek() {
    const [formdata,setFormdata]=useState({
        trekName:"",maxAltitude:"",
        trekKilometer:"",region:"",
        location:"",baseCamp:"",
        suitableFor:"",airportName:"",
        railwayStationName:"",seasonName:"",
        gradeCategory:"",history:""
    })

    const [airport,setAirport] = useState();
    const [station,setStation] = useState();
    const [season,setSeason] = useState();
    const [grade,setGrade] = useState();

    useEffect(() => {
        axios.get('http://localhost:7070/admin/getairport')
        .then(response => {
            setAirport(response.data);
            console.log(response.data);
        })
        .catch(error => {
            console.error(error);
        });

        axios.get('http://localhost:7070/admin/getstation')
          .then(response => {
            setStation(response.data);
            console.log(response.data);
        })
        .catch(error => {
            console.error(error);
        });

        axios.get('http://localhost:7070/admin/getseason')
          .then(response => {
            setSeason(response.data);
            console.log(response.data);
        })
        .catch(error => {
            console.error(error);
        });

        axios.get('http://localhost:7070/admin/getgrade')
          .then(response => {
            setGrade(response.data);
            console.log(response.data);
        })
        .catch(error => {
            console.error(error);
        });
    }, []);

    const handleChange=(e)=>{
        var formdatacopy = {...formdata}
        formdatacopy[e.target.name] = e.target.value;
        setFormdata(formdatacopy);
    }

    const handleSubmit=()=>{
        console.log("Inside handle submit");
        console.log(formdata);
        axios.post("http://localhost:7070/admin/addtrek",formdata)
        .then((response)=>{setserverresp(response.data.status)})
        .catch((error=>{console.log(error)}))

        if(serverresp){
          history.push("/login");
        }
    }

    return (
    <div>
      <form style={{width:"50%",left:"450px",position:"absolute",boxShadow:"10px 10px 10px 5px grey",padding:"20px",marginTop:"10px"}}>
        <div className="form-row">
          <div className="form-group col-md-6">
            <label htmlFor="inputTrekName">Trek Name</label>
            <input type="text" 
            className="form-control" 
            id="trekName"
            name="trekName"
            value={formdata.trekName} 
            onChange={handleChange}
            placeholder="Trek Name" 
            />
          </div>

          <div className="form-group col-md-6">
            <label htmlFor="inputTrekAltitude">Altitude</label>
            <input type="text" 
            className="form-control" 
            id="maxAltitude" 
            name="maxAltitude"
            value={formdata.maxAltitude} 
            onChange={handleChange}
            placeholder="Altitude" 
            />
          </div>

          <div className="form-group col-md-6">
            <label htmlFor="inputEmail4">Trekking Kms</label>
            <input type="text" 
            className="form-control" 
            id="trekKilometer" 
            name="trekKilometer"
            value={formdata.trekKilometer} 
            onChange={handleChange}
            placeholder="Kilometers"/>
          </div>

        <div className="form-group col-md-6">
            <label htmlFor="inputPassword4">Region</label>
            <input type="text" 
            className="form-control"
            id="region" 
            name="region"
            value={formdata.region} 
            onChange={handleChange}
            placeholder="Region" 
            />
          </div>
        </div>



        <div className="form-row">
            <div className="form-group col-md-4">
            <label htmlFor="inputCity">Airport</label>
            <select
                id="inputAirport"
                name="airportName"
                className="form-control"
                value={formdata.airportName} 
                onChange={handleChange}
             >
            <option value="">Choose...</option>
            {airport && airport.map((airportObj, index) => (
            <option key={index} value={airportObj.airportName}>{airportObj.airportName}</option>
            ))}
            </select>
            </div>

            <div className="form-group col-md-4">
            <label htmlFor="inputStation">Station</label>
            <select
                id="inputStation"
                name="railwayStationName"
                className="form-control"
                value={formdata.railwayStationName} 
                onChange={handleChange}
             >
            <option value="">Choose...</option>
            {station && station.map((stateObj, index) => (
            <option key={index} value={stateObj.stationName}>{stateObj.stationName}</option>
            ))}
            </select>
            </div>


            <div className="form-group col-md-4">
            <label htmlFor="inputState">Country</label>
            <select
                id="inputCountry"
                name="countryName"
                className="form-control"
                value={formdata.countryName} 
                onChange={handleChange}
             >
            <option value="">Choose...</option>
            {country && country.map((countryObj, index) => (
            <option key={index} value={countryObj.countryName}>{countryObj.countryName}</option>
            ))}
            </select>
            </div>
        </div>

        <div>
        <label className="form-label" htmlFor="customFile">
            Upload an Image
        </label>
        <input type="file" className="form-control" id="customFile" />
        </div>
        <button type="button" onClick={handleSubmit} className="btn btn-primary">Sign up</button>
      </form>
    </div>
  );
}

export default AddTrek;
